window.bookSummaryJSON = "<p><b>When vengeance strikes....</b></p> <p>You don’t know me, but I know you.</p> <p>I’m the shadow that creeps behind you without notice.</p> <p>The moment you see me, you’re dead.</p> <p>An assassin. A killer. A nobody.</p> <p>Until I became somebody.</p> <p>I’ll make everyone who reduced me to a shadow pay.</p> <p>To do that, I’m willing to risk everything. </p> <p>Everything except for my reluctant wife.</p> <p>Rai Sokolov can show me her worst, but this will only end when death does us part.</p> <p>The road to the throne is paved with loss, betrayal, and blood baths.</p> <p>To win, we go all in.</p> <p>Our lives included.</p> <p><i>Throne of Vengeance</i> is the conclusion of the Throne Duet and cannot be listened to on its own.</p>"; 
